import Footer from "./Footor";
import "./style.css"
import Cards from "./Blog_card"
import Card_soon from "./Card_soon";

function Blog() {
  return (
    <div>
      <div className="w-full h-screen gap-5  bg-themeblack pt-32 px-20 relative flex flex-col z-30 ">
        <div className="w-full h-auto  bg-themegreen glow-hover glass-green2_button overflow-hidden text-white" >
          <h1 className=" font-serif text-6xl">Price action</h1>
          <h2>
            SMC Concepts Simplified 

            Master Market Structure 

            Candlestick Reading

            Price Readings 

            Technical & Fundamental Analysis 

            Real-World Application

            Wealth Creation Focus 
          </h2>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Blog;
